private void processCancelledNodes() {
  while(!cancelledNodes.isEmpty()) {
    DatanodeDescriptor dn = cancelledNodes.poll();
    outOfServiceNodeBlocks.remove(dn);
    pendingRep.remove(dn);
  }
}
